import React, { useState, useEffect } from "react";
import "./pagina.css";
import "./modal.css";
import imagen from"../img/img1.png"

const Panel = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://654b787c5b38a59f28ef218e.mockapi.io/products")
      .then((response) => response.json())
      .then((data) => {
        setData(data);
      })
      .catch((error) => {
        console.error("Error al obtener los datos:", error);
      });
  }, []);


  return (
    <div className="app">
      <div>
        <h1 className="pagina"></h1>
        <p className="paginas">Aqu√≠ puedes visualizar las bebidas</p>
      </div>
      <div className="tabla-container">
        <table className="tabla">
          <thead>
            <tr></tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr
                key={item.id}
                className="rectangulo"
                style={{ cursor: "pointer" }}
              >
                <td colSpan={1}>
                  <div className="informacion">
                    <div className="info2">{item.price}</div>
                    <div className="info2">{item.size}</div>
                    <div className="informacion">
                <div className="image-container">


               <div class="carousel">
               <ul class="slides">
                <img src={imagen} alt="Product" className="product-image" />
                   </ul>
                   </div>


               <div className="a">

           <div className="a">{item.name}</div>
               <div className="a1">{item.description}</div> </div>


              </div>
                </div>
                  </div>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Panel;
